import React from 'react';

import './Header.css'

const Header = () => {
    return (
        <div className='header-frame'>
            <h1>Visualization Tool</h1>
            <button type='button'>Help</button>
            <FontAwesomeIcon icon="fa-solid fa-circle-info" />
        </div>
    );
};

export default Header;
